tables.table_schema:
CREATE TABLE spending_trends (
    user_id UUID PRIMARY KEY,
    date DATE,
    category VARCHAR(255),
    expense_amount DECIMAL
);

CREATE TABLE transactions (
    transaction_id UUID PRIMARY KEY,
    amount DECIMAL,
    transaction_date DATE,
    category TEXT
);

CREATE TABLE users (
    user_id UUID PRIMARY KEY,
    username TEXT,
    email TEXT,
    join_date DATE
);

CREATE TABLE trends (
  id INT PRIMARY KEY,
  date DATE NOT NULL,
  category VARCHAR(255) NOT NULL,
  amount DECIMAL(10, 2) NOT NULL
);

CREATE TABLE users (
  user_id INT PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  email VARCHAR(255) UNIQUE NOT NULL,
  age INT
);

CREATE TABLE categories (
  category_id INT PRIMARY KEY,
  name VARCHAR(255) UNIQUE NOT NULL
);

CREATE TABLE spending_patterns (
  id INT PRIMARY KEY,
  date DATE,
  category VARCHAR,
  amount DECIMAL
);

CREATE TABLE income (
  id INT PRIMARY KEY,
  date DATE,
  source VARCHAR,
  amount DECIMAL
);

CREATE TABLE savings (
  id INT PRIMARY KEY,
  date DATE,
  account VARCHAR,
  balance DECIMAL
);

CREATE TABLE investments (
  id INT PRIMARY KEY,
  date DATE,
  type VARCHAR,
  amount DECIMAL
);

CREATE TABLE expenses (
  id INT PRIMARY KEY,
  date DATE,
  item VARCHAR,
  cost DECIMAL
);
